public void testBasicKeepOrigOneOutput() throws Exception {
  SynonymMap.Builder b = new SynonymMap.Builder();
  add(b, "a b", "x", true);

  Analyzer a = getAnalyzer(b, true);
  assertAnalyzesTo(a,
                   "c a b",
                   new String[] {"c", "x", "a", "b"},
                   new int[]    { 0,   2,   2,   4},
                   new int[]    { 1,   5,   3,   5},
                   new String[] {"word", "SYNONYM", "word", "word"},
                   new int[]    { 1,   1,   0,   1},
                   new int[]    { 1,   2,   1,   1});
  a.close();
}

